import Card, {TopBar} from './Components.js';
import './App.css';

import React from "react";

function ResourcesCyberSecurityAndPrivacy() {
    return(
        <>
            <TopBar/>
            <div className='background-color-verylightorange page-intro-styling'>
                <div>
                <h1 className='page-title-styling' style={{color: "darkorange"}}>Cybersecurity &<br/> Privacy</h1>
                <p>Cybersecurity and privacy are significant issues that can impact a person's daily<br/>life. Lebanese authorities, such as Telecommunications Regulatory Authority,<br/> the Internal Security Forces, and the Lebanse General Security address relevant<br/>issues and advice citizens to be vigilant in the digital world.</p>
                </div>
                <img className='image-styling' src="Desktop-Lock--Streamline-Flex-Neon.png" alt="security" width="500" height="333" />
            </div>
            <div className='resources-part-styling'>
                <h1>Resources</h1>
                <div className='card-grid-display-styling'>
                    <div>
                        <Card
                            title="Account Protection"
                            content={<>Protect your online accounts such as<br/>social media and email.</>}
                        />
                        <Card
                            title="Device Protection"
                            content={<>Protect your online accounts such as<br/>social media and email.</>}
                        />
                    </div>
                </div>
            </div>
        </>
    );
}

export default ResourcesCyberSecurityAndPrivacy;
